claims:
1. A method, comprising:
receiving surgical data in a syndicated format with at least one computer, the data captured from a medical device while the medical device is being used in a surgery;
storing the surgical data in at least two pools, a first pool for personal information and a second pool for non-personal surgical information, wherein the personal information is information that may be used to identify a specific person;
securing the surgical data in at least the first pool with the at least one computer with a conditional access mechanism to provide a secure item, wherein the conditional access mechanism is selected from the group consisting of: userid and password; encryption; a secure server; a digital signature; and an identity certificate; and
publishing the secure item in a syndicated data feed, wherein the syndicated feed comprises health data collected, stored or analyzed by at least one health data collector selected from the group consisting of organizations where health data is collected, community health clinics, emergency personnel, hospitals, hospices, nursing homes, public health screening sites, mobile screening facilities, community health drives, blood drives, school clinics, emergency rooms and physician offices.

19. A method, comprising:
receiving surgical data in a syndicated format with at least one computer, the data captured from a medical device while the medical device is being used in a surgery;
storing the surgical data in at least two pools, a first pool for personal information and a second pool for non-personal surgical information, wherein the personal information is information that may be used to identify a specific person;
securing the surgical data in at least the first pool with the at least one computer with a conditional access mechanism to provide a secure item, wherein the conditional access mechanism is selected from the group consisting of: userid and password; encryption; a secure server; a digital signature; and an identity certificate; and
publishing the secure item in a syndicated data feed, wherein the syndicated data feed comprises community-based health data cases selected from the group consisting of disease, disorder, illness, medical condition, heart disease, cancer, diabetes, stroke, trauma, influenza and immunizations.
